      DATA (MOD(I,  4),I=  1,  6)/&
      1,0,0,0,0,0 /
      DATA (MOD(I,  5),I=  1,  6)/&
      1,0,0,0,0,0 /
      DATA (MOD(I,  6),I=  1,  6)/&
      0,0,0,0,0,0 /
      DATA (MOD(I,  7),I=  1,  6)/&
      0,0,0,0,0,0 /
      DATA (CMOD(I),I=  1,  6) &
      /'VIT','AQ','RET','SERUM','OPT','IRIS'/
      FORALL (I=1:6) NAME(I)=CMOD(I)
      FORALL (I=1:6,J=1:7) IATT(I,J)=MOD(I,J)
